(40, '茄汁燉肉丸', 'good', 10, '義式料理', '6', '牛絞肉200g,番茄2顆,洋蔥2顆,雞蛋3顆,麵粉200g', '1.番茄切丁，洋蔥切細末備用。\r\n2.取一容器，放入牛絞肉、豬絞肉、洋蔥末、雞蛋、，用手混合均勻並帶有黏性\r\n3.將混合後的食材做成肉丸，然後裹上一層麵粉\r\n4.平底鍋熱鍋，倒入蒜風味油，放入香草肉丸煎至金黃色取出，放在盤上備用\r\n5.原鍋放入牛番茄丁，加入玫瑰鹽、百搭香草、香蒜黑胡椒調味，並加入適量的水，煮2分鐘並帶有濃稠度\r\n6.加入香草肉丸，小火燜煮約3分鐘，檢查香草肉丸是否已全熟。盛盤後，灑上洋香菜葉即完成', '一口接一口', , 0);
